import React from 'react';
import Post from './post/post';
import Profile from './profile/profile';
import AddPost from "./addPost/addPost";

const Content = (props) => {
    let dialogsPost = props.posts.postData.map(post => <Post message={post.message} like={post.like}/>);
    return (
        <div>
            <Profile/>
            <AddPost dispatch={props.dispatch} posts={props.posts}/>
            {dialogsPost}
        </div>
    );
}
export default Content;
